import { useContext } from 'react';

import AppContext from '../AppContext';
import HeroSearch from '../Homepage/HeroSearch';

function SearchFilter(props) {
  const { isMobile } = useContext(AppContext);

  if (isMobile) {
    return null;
  }

  return <HeroSearch />;
}

export default SearchFilter;
